import { Component, OnInit } from '@angular/core';
import { Router, ActivatedRoute , Params } from '@angular/router';

@Component({
  selector: 'app-pagina',
  templateUrl: './pagina.component.html',
  styleUrls: ['./pagina.component.css']
})
export class PaginaComponent implements OnInit {

  public nombre: string;
  public apellido: string;
  public peliculas: Array<any>;

  constructor(
    // tslint:disable-next-line: variable-name
    private _route: ActivatedRoute,
    // tslint:disable-next-line: variable-name
    private _router: Router){
      this.peliculas = [
        {title: 'spiderman 4', imagen: 'data:image/jpeg;base64,'},
        {title: 'batman', imagen: 'https://static.euronews.com/articles/stories/04/88/43/56/1440x810_cmsv2_1fdac254-db8d-5873-819e-614cf029656e-4884356.jpg'},
        {title: 'jhon wick', imagen: 'data:image/jpeg;base64,'},
        {title: 'jhon Dalton', imagen: 'data:image/jpeg;base64,'}
      ];
    }

  ngOnInit(): void {
    this._route.params.subscribe((params: Params) => {
       this.nombre = params.nombre;
       this.apellido = params.apellido;
       console.log(this.peliculas);
    });
  }

  // tslint:disable-next-line: typedef
  redireccion(){
    this._router.navigate(['/pagina-de-prueba', 'fernando', 'develop']);
  }

}
